  false,\n\t\"url\": null,\n\t\"notes\": \"The present distributional patterns of
  birds and mammals on the surface of the earth are the combined result of historic
  and current factors. The historic factors include the ancestry and geographic origin
  of the species, and geologic and climatic conditions. The current factors are those
  of topography, climate, habitat, and competition. The relative importance of these
  factors varies with the nature and habits of the animal and its aggressiveness and
  adaptability.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
